import React from "react";
import NavButton1 from "../NavButton1";


function Header2(props) {
  const { navButton11Props, navButton12Props, navButton13Props, navButton14Props } = props;

  return (
    <div className="header-2">
      <NavButton1>{navButton11Props.children}</NavButton1>
      <NavButton1 className={navButton12Props.className}>{navButton12Props.children}</NavButton1>
      <NavButton1>{navButton13Props.children}</NavButton1>
      <NavButton1>{navButton14Props.children}</NavButton1>
    </div>
  );
}

export default Header2;
